  return (

    <div className='absolute flex-1' >
      <div className='absolute'>
        <img src={background} alt='background' className='background' />
      </div>


      <div>
        <Link to='/menu' >
          <img className='relative ' src={btn} alt="Unknown" ></img>
        </Link>
      </div>
      <h1> 
        <b>Our Food</b>
      </h1>
    </div>
  )
}
